export default function FamilyIncomeForm() {
    const now = 55;
    const progressInstance = <ProgressBar style={{height: '0.5rem'}} now={now} />;
    const dispatch = useContext(DispatchContext);
    const router = useRouter();

    return (
        <div>
            <br />
            <Row>
                <Col
                    xs={{ span: 10, offset: 1 }}
                    md={{ span: 10, offset: 1 }}
                    lg={{ span: 10, offset: 1 }}
                >
                    {progressInstance}
                </Col>
            </Row>
            <br />
            <Row>
                <Col
                    xs={{ span: 5, offset: 1 }}
                    md={{ span: 3, offset: 3 }}
                    lg={{ span: 3, offset: 3 }}
                >
                    <h5>You</h5>
                </Col>
                <Col
                    xs={{ span: 5, offset: 1 }}
                    md={{ span: 3, offset: 3 }}
                    lg={{ span: 3, offset: 3 }}
                >
                    <h5>Spouse</h5>
                </Col>
            </Row>
        </div>
    )
}
